class DivInputCheckbox extends InputMultipleValue{async getValue(){const t=[],e=this.input.find("input:checked").toArray();for(const n of e){const e=InputFactory.getInstance($(n),this.params);t.push(await e.getValue())}return t}getValueGrid(){const t=[];return this.input.find("input:checked").each((e,n)=>{const u=InputFactory.getInstance($(n),this.params);t.push(u.getValueGrid())}),t.join(", ")}setValue(t){this.input.find(`input[value="${t}"]`).prop("checked",!0)}}